import React from'react';
const PlayerCard = prop => {
    return(
    <div id={prop.player_id}>
        <p>{prop.name}</p>
        <p>{prop.position}</p>
        <p>{prop.current_team}</p>
    </div>
    );
}

export default PlayerCard
